member.summary:
Tratar caracteres especiais existentes na string substituindo por escape.
Caracteres substituídos:   & < > \ ' 
Escapes utilizados:   &amp; &lt; &gt; &quot; &#39;

member.example:
var texto = "Dias \ Dias";
texto = XMLUtility.TratarCaracterEspecial(texto);
MessageBox.Show(texto); // Retorno será: "Dias " Dias"

